import React, { Component } from 'react'
import MapContainer from '../src/containers/mapcontainer'
import './index.css';
import SearchForm from '../src/components/searchform.js'
import FavBeaches from '../src/components/favbeaches'
// import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
// import MainDisplay from './src/containers/main?display'
// import Map from './src/containers/map'
// import SearchBar from '../src/components/searchbar'
export default class App extends Component {
    state = {
        results:[]
    }
    grabBeaches = (results) => {
        let prevState = this.state.results
        this.setState({...prevState, results})
        this.state.results.map(beach=> {
            let favBeach = {name:beach['NameMobileWeb'], img:beach['Photo_1'], lat:beach['LATITUDE'], lng:beach['LONGITUDE']}
            const url = 'http://localhost:3000/favbeaches'
            fetch(url,
            {method: 'POST',
            body:JSON.stringify(favBeach),
            headers:{
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }}
            ).then(res=>res.json())
            .catch(error=>console.log(error))
        })
    }
    render() {

        return (
            <div>
                    <div id="search-bar">
                    <SearchForm grabBeaches={this.grabBeaches}/>
                    </div>

                    <div id="map-showcase"> 
                    {/* <FavBeaches/>                 */}
                    <MapContainer beaches={this.state.results}/>
                    </div>
                    {/* <MuiThemeProvider>
                    <SearchBar/>
                    </MuiThemeProvider> */}
            </div>
        )
    }
}
